import React from 'react';
import Switch from 'react-router-dom/Switch';
import withRouter from 'react-router-dom/withRouter';

const SwitchWithRouter = (props) => (
    <Switch>
        {props.children}
    </Switch>
)

export default withRouter(SwitchWithRouter);
